function RandomImage(props) {

  const imgsrc = `https://source.unsplash.com/720x1080/?${props.name}`;
  const imgsrc2 = `https://source.unsplash.com/720x1080/?${props.name}`;
  const imgsrc3 = `https://source.unsplash.com/720x1080/?${props.name}`;
//   const alttext = props.name + " image";  
  return (
        <>
           <img src={imgsrc} alt='image' />
           <img src={imgsrc2} alt='image2' />
           <img src={imgsrc3} alt='image3' />
        </>
  )
}

export default RandomImage;
